import React from 'react';
import { BrowserRouter, Switch } from 'react-router-dom'
import Navbar from './components/layout/Navbar'

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Navbar />
      <Switch></Switch>
    </div>
    </BrowserRouter>
  );
}

export default App;
